// CustomNode.js
import React, { useState } from "react";
import { Handle } from "reactflow";

const CustomNode = ({ data }) => {
  const [showPopup, setShowPopup] = useState(false);
  const [popupValue, setPopupValue] = useState("");

  const handleDropdownChange = (e) => {
    if (e.target.value === "Create New") {
      setShowPopup(true);
    } else {
      data.onDropdownChange(e.target.value);
    }
  };

  const handleNumberChange = (e) => {
    data.onNumberChange(e.target.value);
  };

  const handleStringChange = (e) => {
    data.onStringChange(e.target.value);
  };

  const handlePopupSubmit = () => {
    data.onDropdownChange(popupValue);
    setShowPopup(false);
  };

  return (
    <div style={{ padding: 10, border: "1px solid #ddd", borderRadius: 4 }}>
      <div>{data.label}</div>
      <select value={data.dropdownValue} onChange={handleDropdownChange}>
        <option value="">Select...</option>
        <option value="Option 1">Option 1</option>
        <option value="Option 2">Option 2</option>
        <option value="Option 3">Option 3</option>
        <option value="Create New">Create New</option>
      </select>
      {showPopup && (
        <div style={{ marginTop: 10 }}>
          <input
            type="text"
            value={popupValue}
            onChange={(e) => setPopupValue(e.target.value)}
            placeholder="Enter value"
          />
          <button onClick={handlePopupSubmit}>Submit</button>
        </div>
      )}
      <input
        type="number"
        value={data.numberValue}
        onChange={handleNumberChange}
        placeholder="Enter a number"
        style={{ marginTop: 10 }}
      />
      <input
        type="text"
        value={data.stringValue}
        onChange={handleStringChange}
        placeholder="Enter a string"
        style={{ marginTop: 10 }}
      />
      <Handle type="source" position="right" />
      <Handle type="target" position="left" />
    </div>
  );
};

export default CustomNode;
